import myPosts from './Profile.module.css'
import '../Profile/Posts/MyPosts'
import Profile from "./Profile";

const ProfileContainer = (props) => {
    return (
        <div className={myPosts.content}>
            <Profile {...props}/>
        </div>
    );
}


export default ProfileContainer;
